sys_ux_client_script.script:
/**
 * @param {params} params
 * @param {api} params.api
 * @param {TransformApiHelpers} params.helpers
 */
function evaluateProperty({
    api,
    helpers
}) {
    if (Object.keys(api.state.activeLocation).length === 0) {
        return api.state.activeLineItem.label;
    } else {
        return api.state.activeLocation.label;
    }
}
